	dcb.l	$10, Exception

; --------------------------------------------------------------
; ROM header
; --------------------------------------------------------------

	dc.b	"SEGA GENESIS    "
	dc.b	"(C)SEGA 1993.SEP"
	dc.b	"Dr. Robotnik's Mean Bean Machine                "
	dc.b	"Dr. Robotnik's Mean Bean Machine                "
	dc.b	"GM MK-1706 -00"
	dc.w	0
	dc.b	"J               "
	dc.l	ROM_START
	dc.l	ROM_END
	dc.l	RAM_START
	dc.l	RAM_END
	dc.b	"  ", $20, $20
	dc.l	$20202020
	dc.l	$20202020
	dc.b	"            "
	dc.b	"                                        "
	dc.b	"U               "

; --------------------------------------------------------------
; Program entry
; --------------------------------------------------------------

Entry:
	; Check if this is a hot start
	tst.l	PORT_A_CTRL-1
	bne.s	.IsHotStart
	tst.w	PORT_C_CTRL-1

.IsHotStart:
	bne.s	.HotStart

	; Set up for initialization
	lea	.InitTable(pc),a5
	movem.w	(a5)+,d5-d7
	movem.l	(a5)+,a0-a4

	; Handle TMSS
	move.b	CONSOLE_VER-Z80_BUS(a1),d0
	andi.b	#$F,d0
	beq.s	.NoTMSS
	move.l	#"SEGA",TMSS_SEGA-Z80_BUS(a1)

.NoTMSS:
	move.w	(a4),d0
	
	; Set up for RAM clear and set user stack pointer
	moveq	#0,d0
	movea.l	d0,a6
	move.l	a6,usp

	; Initialize VDP registers
	moveq	#.VDPRegsInit_End-.VDPRegsInit-1,d1

.InitVDPRegs:
	move.b	(a5)+,d5
	move.w	d5,(a4)
	add.w	d7,d5
	dbf	d1,.InitVDPRegs

	; Clear VRAM
	move.l	(a5)+,(a4)
	move.w	d0,(a3)

	; Initialize the Z80
	move.w	d7,(a1)
	move.w	d7,(a2)

.WaitZ80Stop
	btst	d0,(a1)
	bne.s	.WaitZ80Stop

	moveq	#.Z80Init_End-.Z80Init-1,d2

.LoadZ80Init:
	move.b	(a5)+,(a0)+
	dbf	d2,.LoadZ80Init

	move.w	d0,(a2)
	move.w	d0,(a1)
	move.w	d7,(a2)

.ClearRAM:
	; Clear RAM
	move.l	d0,-(a6)
	dbf	d6,.ClearRAM

	; Reset VDP registers 1 and 15
	move.l	(a5)+,(a4)

	; Clear CRAM
	move.l	(a5)+,(a4)
	moveq	#$80/4-1,d3

.ClearCRAM:
	move.l	d0,(a3)
	dbf	d3,.ClearCRAM

	; Clear VSRAM
	move.l	(a5)+,(a4)
	moveq	#$50/4-1,d4

.VSRAM:
	move.l	d0,(a3)
	dbf	d4,.VSRAM

	; Silence PSG
	moveq	#.PSGSilence_End-.PSGSilence-1,d5

.SilencePSG:
	move.b	(a5)+,PSG_CTRL-VDP_DATA(a3)
	dbf	d5,.SilencePSG

	; Set Z80 reset
	move.w	d0,(a2)

	; Reset registers
	movem.l	(a6),d0-a6
	move	#$2700,sr

.HotStart:
	; Go to game program
	bra.s	.GameProgram

; --------------------------------------------------------------
; Initialziation table
; --------------------------------------------------------------

.InitTable:
	; d5-d7
	dc.w	$8000
	dc.w	$3FFF
	dc.w	$100

	; a0-a4
	dc.l	ZRAM_START
	dc.l	Z80_BUS
	dc.l	Z80_RESET
	dc.l	VDP_DATA
	dc.l	VDP_CTRL

.VDPRegsInit:
	; VDP register data
	dc.b	$04
	dc.b	$14
	dc.b	$30
	dc.b	$3C
	dc.b	$07
	dc.b	$6C
	dc.b	$00
	dc.b	$00
	dc.b	$00
	dc.b	$00
	dc.b	$FF
	dc.b	$00
	dc.b	$81
	dc.b	$37
	dc.b	$00
	dc.b	$01
	dc.b	$01
	dc.b	$00
	dc.b	$00
	dc.b	$FF
	dc.b	$FF
	dc.b	$00
	dc.b	$00
	dc.b	$80
.VDPRegsInit_End:

	; VRAM DMA at $0000
	dc.l	$40000080

.Z80Init:
	; Z80 initialization program
	dc.b	$AF
	dc.b	$01, $D9, $1F
	dc.b	$11, $27, $00
	dc.b	$21, $26, $00
	dc.b	$F9
	dc.b	$77
	dc.b	$ED, $B0
	dc.b	$DD, $E1
	dc.b	$FD, $E1
	dc.b	$ED, $47
	dc.b	$ED, $4F
	dc.b	$D1
	dc.b	$E1
	dc.b	$F1
	dc.b	$08
	dc.b	$D9
	dc.b	$C1
	dc.b	$D1
	dc.b	$E1
	dc.b	$F1
	dc.b	$F9
	dc.b	$F3
	dc.b	$ED, $56
	dc.b	$36, $E9
	dc.b	$E9
.Z80Init_End:

	; VDP register 1 and 15 reset
	dc.w	$8104
	dc.w	$8F02

	; CRAM and VSRAM write at $0000
	dc.l	$C0000000
	dc.l	$40000010

.PSGSilence:
	; PSG silence data
	dc.b	$9F
	dc.b	$BF
	dc.b	$DF
	dc.b	$FF
.PSGSilence_End:

; --------------------------------------------------------------
; Game program
; --------------------------------------------------------------

.GameProgram:
	tst.w	VDP_CTRL
	DISABLE_INTS
	bsr.w	WaitDMA
	bsr.w	InitGame
	ENABLE_INTS

.GameLoop:
	bsr.w	VSync
	jsr	sub_90C6
	bsr.w	ReadCtrls_Safe
	bsr.w	RunBytecode
	bsr.w	RunActors
	jsr	DrawActors
	bra.s	.GameLoop

; --------------------------------------------------------------
; VSync
; --------------------------------------------------------------

VSync:
	lea	frame_count,a0
	move.w	(a0),d0

.Wait:
	cmp.w	(a0),d0
	beq.s	.Wait
	rts

; --------------------------------------------------------------
; Loads the default high score table into RAM
; --------------------------------------------------------------

LoadDefaultHighScores:
	lea	.Scores,a1
	lea	high_scores,a2
	move.w	#$27,d0

.Load:
	move.l	(a1)+,(a2)+
	dbf	d0,.Load

	rts

; --------------------------------------------------------------

.Scores:
	dc.b 4, $12, $12
	dc.b $FF, $FF, $FF
	dc.l 18594
	dc.w 416
	dc.l 0
	dc.b $13, 3, $12
	dc.b $FF, $FF, $FF
	dc.l 16976
	dc.w 348
	dc.l 0
	dc.b 4, 2, 0
	dc.b $FF, $FF, $FF
	dc.l 12382
	dc.w 204
	dc.l 0
	dc.b $13, 9, $12
	dc.b $FF, $FF, $FF
	dc.l 9260
	dc.w 137
	dc.l 0
	dc.b $13, $10, $B
	dc.b $FF, $FF, $FF
	dc.l 6650
	dc.w 152
	dc.l 0
	dc.b 7, $12, 4
	dc.b $FF, $FF, $FF
	dc.l 108382
	dc.w 558
	dc.l 0
	dc.b 4, $19, $E
	dc.b $FF, $FF, $FF
	dc.l 105375
	dc.w 499
	dc.l 0
	dc.b $13, $B, $17
	dc.b $FF, $FF, $FF
