; --------------------------------------------------------------
; Checks the high score table for broken entries and fixes them
; --------------------------------------------------------------

FixHighScores:
	lea	high_scores,a1
	moveq	#9,d0

.Loop:
	move.l	0(a1),d1
	bpl.s	.Store
	move.l	#$1B1B1BFF,d1

.Store:
	move.l	d1,(a1)
	lea	$10(a1),a1
	dbf	d0,.Loop

	rts

; --------------------------------------------------------------
; Initialize options
; --------------------------------------------------------------

InitOptions:
	move.b	#2,com_level
	move.b	#1,game_matches
	move.b	#0,disable_samples
	move.b	#2,player_1_a
	move.b	#1,player_1_b
	move.b	#2,player_1_c
	move.b	#2,player_2_a
	move.b	#1,player_2_b
	move.b	#2,player_2_c
	rts

; --------------------------------------------------------------
; Wait for DMA to be over
; --------------------------------------------------------------

WaitDMA:
	nop
	nop
	nop
	nop
	move.w	VDP_CTRL,d0
	btst	#1,d0
	bne.s	WaitDMA
	rts

; --------------------------------------------------------------
; Initialize the game
; --------------------------------------------------------------

InitGame:
	lea	is_japan,a1
	jsr	sub_23566
	cmp.w	stack_base,d0
	beq.w	.Initialize

	lea	byte_FFFE00+2,a1
	jsr	sub_23566
	cmp.w	byte_FFFE00,d0
	beq.w	.Copy
	bsr.w	.sub_4BE

.Copy:
	lea	byte_FFFE00,a1
	lea	stack_base,a2
	move.w	#$2C-1,d0

.CopyLoop:
	move.l	(a1)+,(a2)+
	dbf	d0,.CopyLoop
	bra.w	.Initialize

; --------------------------------------------------------------

.sub_4BE:
	lea	stack_base,a0
	moveq	#0,d0
	move.w	#$100-1,d1

.Loop:
	move.l	d0,(a0)+
	dbf	d1,.Loop

	bsr.w	LoadDefaultHighScores
	bsr.w	InitOptions

	move.w	#$FFFF,current_password
	jmp	sub_23536

; --------------------------------------------------------------

.Initialize:
	move.w	current_password,d2
	lea	RAM_START,a0
	moveq	#0,d0
	move.w	#$F000/4-1,d1

.ClearRAM:
	move.l	d0,(a0)+
	dbf	d1,.ClearRAM
	move.w	d2,current_password

	jsr	InitSound
	bsr.w	InitVDP
	bsr.w	InitBytecode
	jsr	InitSpriteDraw
	bsr.w	InitControllers
	jsr	DrawActors
	bsr.w	TransferSprites
	bsr.w	FixHighScores
	bsr.w	CopyPalToCRAM

	lea	vdp_reg_1,a0
	ori.b	#$40,(a0)
	move.w	#$8100,d0
	move.b	(a0),d0
	move.w	d0,VDP_CTRL

	rts

; --------------------------------------------------------------
; Exception
; --------------------------------------------------------------

Exception:
	DISABLE_INTS
	bsr.w	InvertPalette
	bsr.w	CopyPalToCRAM

.Loop:
	nop
	nop
	bra.s	.Loop

; --------------------------------------------------------------
; Clear carry flag
; --------------------------------------------------------------

ClearCarry:
	CLEAR_CARRY
	rts

; --------------------------------------------------------------
; V-BLANK routine
; --------------------------------------------------------------

VBlank:
	DISABLE_INTS
	movem.l	d0-a6,-(sp)

	addq.w	#1,frame_count

.WaitDMA:
	move.w	VDP_CTRL,d0
	btst	#1,d0
	bne.s	.WaitDMA

	move.w	dma_slot,d2
	beq.w	.NoDMA
	lsr.w	#4,d2
	subq.w	#1,d2

	lea	dma_queue,a0
	lea	VDP_CTRL,a1

.DMALoop:
	move.w	#$8100,d0
	move.b	vdp_reg_1,d0
	ori.b	#$10,d0
	move.b	d0,vdp_reg_1
	move.w	d0,VDP_CTRL

	move.w	(a0)+,(a1)
	move.l	(a0)+,(a1)
	move.l	(a0)+,(a1)
	move.l	(a0)+,(a1)
	Z80_STOP
	move.w	(a0)+,(a1)

.WaitDMA2:
	move.w	VDP_CTRL,d0
	btst	#1,d0
	bne.s	.WaitDMA2
	
	move.w	#$8100,d0
	move.b	vdp_reg_1,d0
	andi.b	#~$10,d0
	move.b	d0,vdp_reg_1
	move.w	d0,VDP_CTRL

	Z80_START
	dbf	d2,.DMALoop

	clr.w	dma_slot
	move.w	#$8F02,VDP_CTRL
	move.b	#2,vdp_reg_f

.NoDMA:
	bsr.w	SetupHBlank
	bsr.w	HandleTime
	jsr	UpdateSound
	bsr.w	TransferSprites
	bsr.w	TransferVScroll
	bsr.w	TransferHScroll
	bsr.w	CopyPalToCRAM
	jsr	ProcPlaneCommands
	jsr	ProcEniTilemapQueue
	bsr.w	Random
	tst.w	use_plane_a_buffer
	beq.w	.End
	bsr.w	TransferPlaneABuffer

.End:
	movem.l	(sp)+,d0-a6
	ENABLE_INTS
	rtr

; --------------------------------------------------------------
; Transfer the plane A buffer to VRAM
; --------------------------------------------------------------

TransferPlaneABuffer:
	tst.w	dma_disabled
	bne.w	.ManualCopy
	DMA_COPY plane_a_buffer, $C000, $E00, VRAM
	rts

.ManualCopy:
	lea	plane_a_buffer,a1
	move.w	#$4000,VDP_CTRL
	move.w	#3,VDP_CTRL
	move.w	#$E00/2-1,d0

.Copy:
	move.w	(a1)+,VDP_DATA
	dbf	d0,.Copy

	rts

; --------------------------------------------------------------
; Handle time
; --------------------------------------------------------------

HandleTime:
	move.b	player_1_flags,d0
	or.b	player_2_flags,d0
	bmi.w	.TimeDisabled

	addq.w	#1,time_frames
	bcc.w	.SplitTime
	subq.w	#1,time_frames

.SplitTime:
	clr.l	d0
	move.w	time_frames,d0
	divu.w	#60,d0
	move.w	d0,time_seconds
	
	clr.l	d0
	move.w	time_seconds,d0
	divu.w	#60,d0
	move.l	d0,time_minutes

.TimeDisabled:
	rts

; --------------------------------------------------------------
; Setup H-BLANK (leftover from Puyo Puyo)
; --------------------------------------------------------------

SetupHBlank:
	clr.w	d0
	move.b	hblank_count,d0
	beq.w	DisableHBlank
	move.w	d0,hblank_counter

	move.l	#hblank_buffer_1,hblank_buffer_ptr
	tst.b	hblank_buffer_id
	beq.w	.Setup
	move.l	#hblank_buffer_2,hblank_buffer_ptr

.Setup:
	move.w	#$8000,d0
	move.b	vdp_reg_0,d0
	ori.b	#$10,d0
	move.w	d0,VDP_CTRL
	move.b	d0,vdp_reg_0
	
	move.w	#$8B00,d0
	move.b	vdp_reg_b,d0
	andi.b	#~4,d0
	move.b	d0,vdp_reg_b

	rts

; --------------------------------------------------------------
; H-BLANK routine (leftover from Puyo Puyo)
; --------------------------------------------------------------

HBlank:
	DISABLE_INTS
	tst.b	hblank_count
	beq.w	.End
	movem.l	a0,-(sp)

	move.l	#$40000010,VDP_CTRL
	movea.l	hblank_buffer_ptr,a0
	move.w	(a0),VDP_DATA
	addq.w	#2,hblank_buffer_ptr+2
	
	subq.w	#1,hblank_counter
	bne.w	.EndRestore

	movem.l	d0,-(sp)
	bsr.w	DisableHBlank
	movem.l	(sp)+,d0

	move.l	#$40000010,VDP_CTRL
	move.w	#0,VDP_DATA

.EndRestore:
	movem.l	(sp)+,a0

.End:
	ENABLE_INTS
	rtr

; --------------------------------------------------------------
; Disable H-BLANK
; --------------------------------------------------------------

DisableHBlank:
	move.w	#$8000,d0
	move.b	vdp_reg_0,d0
	andi.b	#~$10,d0
	move.w	d0,VDP_CTRL
	move.b	d0,vdp_reg_0
	rts

; --------------------------------------------------------------
; Initialize the palette pointer list
; --------------------------------------------------------------

InitPalettePtrs:
	move.w	#4-1,d0
	lea	palette_pointers,a0
	lea	palette_buffer,a1

.LineLoop:
	tst.w	(a0)
	bne.w	.NextLine
	move.w	#-1,0(a0)
	move.l	a1,2(a0)

.NextLine:
	adda.l	#6,a0
	adda.l	#$20,a1
	dbf	d0,.LineLoop

	rts

; --------------------------------------------------------------
; Copy palette to CRAM
; --------------------------------------------------------------

CopyPalToCRAM:
	lea	palette_pointers,a2
	lea	palette_buffer,a3

	move.w	#4-1,d0
	moveq	#0,d1

.LineLoop:
	tst.w	(a2)
	beq.w	.NextLine
	clr.w	(a2)
	bsr.w	CopyPalLineToCRAM

.NextLine:
	adda.l	#6,a2
	adda.l	#$20,a3
	addi.b	#$20,d1

	dbf	d0,.LineLoop
	rts

; --------------------------------------------------------------
; Copy palette line to CRAM
; --------------------------------------------------------------
; PARAMETERS:
;	d1.w	- CRAM offset
;	a2.l	- Palette pointer list
;	a3.l	- Palette buffer
; --------------------------------------------------------------

CopyPalLineToCRAM:
	movem.l	a3,-(sp)

	movea.l	2(a2),a4
	move.w	#$C000,d2
	move.b	d1,d2
	move.w	d2,VDP_CTRL
	move.w	#0,VDP_CTRL

	move.w	#$20/2-1,d2

.CopyPal:
	move.w	(a4),VDP_DATA
	move.w	(a4)+,(a3)+
	dbf	d2,.CopyPal

	movem.l	(sp)+,a3
	rts

; --------------------------------------------------------------
; Transfer the sprite buffer to VRAM
; --------------------------------------------------------------

TransferSprites:
	tst.w	sprite_count
	bne.w	.CheckDMA
	rts

.CheckDMA:
	tst.w	dma_disabled
	bne.w	.ManualCopy

	lea	VDP_CTRL,a0
	move.w	#$8100,d0
	move.b	vdp_reg_1,d0
	ori.b	#$10,d0
	move.w	d0,(a0)

	move.w	#$9400,d0
	move.b	sprite_count,d0
	move.w	d0,(a0)
	move.w	#$9300,d0
	move.b	sprite_count+1,d0
	move.w	d0,(a0)
	move.w	#$9600|((sprite_buffer>>9)&$FF),(a0)
	move.w	#$9500|((sprite_buffer>>1)&$FF),(a0)
	move.w	#$9700|((sprite_buffer>>17)&$7F),(a0)
	move.w	#$7C00,(a0)
	move.w	#$82,dma_cmd_low
	Z80_STOP
	move.w	dma_cmd_low,(a0)
	move.w	#$8100,d0
	move.b	vdp_reg_1,d0
	move.w	d0,(a0)
	Z80_START

	clr.w	sprite_count
	rts

.ManualCopy:
	lea	sprite_buffer,a1
	move.w	#$7C00,VDP_CTRL
	move.w	#2,VDP_CTRL
	move.w	sprite_count,d0
	subq.w	#1,d0

.Copy:
	move.w	(a1)+,VDP_DATA
	dbf	d0,.Copy

	clr.w	sprite_count
	rts

; --------------------------------------------------------------
; Transfer the vertical scroll buffer to VRAM
; --------------------------------------------------------------

TransferVScroll:
	move.w	#$8B00,d0
	move.b	vdp_reg_b,d0
	move.w	d0,VDP_CTRL
	move.w	#$8C00,d0
	move.b	vdp_reg_c,d0
	move.w	d0,VDP_CTRL

	btst	#2,vdp_reg_b
	bne.w	.ColumnScroll

	move.l	#$40000010,VDP_CTRL
	move.w	vscroll_buffer,VDP_DATA
	move.w	vscroll_buffer+2,VDP_DATA

	rts

.ColumnScroll:
	tst.w	dma_disabled
	bne.w	.ManualCopy
	DMA_COPY vscroll_buffer, 0, $50, VSRAM
	rts

.ManualCopy:
	lea	vscroll_buffer,a1
	move.l	#$40000010,VDP_CTRL
	move.w	#$50/2-1,d0

.Copy:
	move.w	(a1)+,VDP_DATA
	dbf	d0,.Copy

	rts

; --------------------------------------------------------------
; Transfer the horizontal scroll buffer to VRAM
; --------------------------------------------------------------

TransferHScroll:
	btst	#1,vdp_reg_b
	bne.w	.RowScroll

	move.w	#$7800,VDP_CTRL
	move.w	#$2,VDP_CTRL
	move.w	hscroll_buffer,VDP_DATA
	move.w	hscroll_buffer+2,VDP_DATA

	rts

.RowScroll:
	tst.w	dma_disabled
	bne.w	.ManualCopy
	DMA_COPY hscroll_buffer, $B800, $400, VRAM
	rts

.ManualCopy:
	lea	hscroll_buffer,a1
	move.w	#$7800,VDP_CTRL
	move.w	#2,VDP_CTRL
	move.w	#$400/2-1,d0

.Copy:
	move.w	(a1)+,VDP_DATA
	dbf	d0,.Copy

	rts

; --------------------------------------------------------------
; Dead leftover code from Puyo Puyo. Appears to be old VRAM
; data buffering code that's also dead in Puyo Puyo.
; --------------------------------------------------------------

DeadVRAMBufCode:
	tst.b	vram_buffer_id
	bne.w	.DoTransfer
	rts

.DoTransfer:
	clr.b	vram_buffer_id

	DMA_COPY vram_buffer, $1000, $800, VRAM

	lea	vram_buffer,a1
	lea	hblank_buffer_1,a2
	move.w	vram_buffer_id,d0
	mulu.w	#$800,d0
	adda.l	d0,a2
	move.w	#$800/2-1,d0

.Copy:
	move.w	(a2)+,(a1)+
	dbf	d0,.Copy

	DMA_COPY vram_buffer, $2000, $800, VRAM

	lea	vram_buffer,a1
	lea	hblank_buffer_1,a2
	move.w	vram_buffer_id,d0
	addq.b	#8,d0
	andi.b	#$F,d0
	mulu.w	#$800,d0
	adda.l	d0,a2
	move.w	#$800/2-1,d0

.Copy2:
	move.w	(a2)+,(a1)+
	dbf	d0,.Copy2
	
	DMA_COPY vram_buffer, $2800, $800, VRAM

	rts

; --------------------------------------------------------------
; Clear scroll buffers
; --------------------------------------------------------------

ClearScroll:
	move.w	#$400/2-1,d0
	lea	hscroll_buffer,a1

.ClearHScroll:
	clr.w	(a1)+
	dbf	d0,.ClearHScroll

	move.w	#$50-1,d0		; Should be "$50/2-1"
	lea	vscroll_buffer,a1

.ClearVScroll:
	clr.w	(a1)+
	dbf	d0,.ClearVScroll

	rts

; --------------------------------------------------------------
; Enable shadow/highlight mode
; --------------------------------------------------------------

EnableSHMode:
	move.w	#$8C00,d0
	move.b	vdp_reg_c,d0
	ori.b	#8,d0
	move.b	d0,vdp_reg_c
	rts

; --------------------------------------------------------------
; Disable shadow/highlight mode
; --------------------------------------------------------------

DisableSHMode:
	move.w	#$8C00,d0
	move.b	vdp_reg_c,d0
	andi.b	#~8,d0
	move.b	d0,vdp_reg_c
	rts

; --------------------------------------------------------------
; Queue a list of plane commands
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- Plane command list ID
; --------------------------------------------------------------

QueuePlaneCmdList:
	DISABLE_INTS
	movem.l	d1-d3/a2-a3,-(sp)

	move.b	#$FF,d2
	lea	PlaneCmdLists,a2
	lsl.w	#2,d0
	movea.l	(a2,d0.w),a3

	move.w	(a3)+,d0
	lea	plane_cmd_count,a2
	move.w	(a2),d1
	add.w	d0,d1

	cmpi.w	#(plane_cmd_queue_end-plane_cmd_queue)/4+1,d1
	bcs.w	.Queue
	clr.b	d2
	subi.w	#(plane_cmd_queue_end-plane_cmd_queue)/4,d1
	move.w	d1,d0
	move.w	#(plane_cmd_queue_end-plane_cmd_queue)/4,d1

.Queue:
	move.w	(a2),d3
	move.w	d1,(a2)+
	lsl.w	#2,d3
	adda.w	d3,a2

	subq.w	#1,d0
	bcs.w	.Done

.QueueLoop:
	move.l	(a3)+,(a2)+
	dbf	d0,.QueueLoop

.Done:
	move.b	d2,d0
	movem.l	(sp)+,d1-d3/a2-a3
	ENABLE_INTS
	subq.b	#1,d0
	rts

; --------------------------------------------------------------
; Queue plane command
; --------------------------------------------------------------
; PARAMETERS:
;	d0.l	- Plane command
; --------------------------------------------------------------

QueuePlaneCmd:
	cmpi.w	#(plane_cmd_queue_end-plane_cmd_queue)/4,plane_cmd_count
	bcs.s	.Queue
	SET_CARRY
	rts

.Queue:
	DISABLE_INTS
	movem.l	d1/a2,-(sp)

	lea	plane_cmd_count,a2
	move.w	(a2),d1
	addq.w	#1,(a2)
	lsl.w	#2,d1
	move.l	d0,2(a2,d1.w)

	movem.l	(sp)+,d1/a2
	ENABLE_INTS
	CLEAR_CARRY
	rts

; --------------------------------------------------------------
; Decompress Puyo compressed art
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- VRAM address
;	a0.l	- Pointer to compressed art
; --------------------------------------------------------------

PuyoDec:
	DISABLE_INTS

	move.w	d0,d1
	andi.w	#$3FFF,d1
	ori.w	#$4000,d1
	move.w	d1,VDP_CTRL
	lsl.l	#2,d0
	swap	d0
	andi.w	#3,d0
	move.w	d0,VDP_CTRL

	lea	puyo_dec_buffer,a1
	lea	puyo_dec_vdp_buf,a2
	clr.w	d0
	clr.w	d1

.DecompLoop:
	move.b	(a0)+,d2
	tst.b	d2
	bmi.w	.CopyBackward
	bne.w	.CopyForward

	ENABLE_INTS
	rts

.CopyForward:
	andi.w	#$7F,d2
	subq.w	#1,d2

.CopyForwardLoop:
	move.b	(a0)+,d4
	move.b	d4,(a2,d1.w)

	addq.b	#1,d1
	btst	#2,d1
	beq.w	.CopyForwardStore
	clr.b	d1
	move.l	(a2),VDP_DATA

.CopyForwardStore:
	move.b	d4,(a1,d0.w)

	addq.b	#1,d0
	dbf	d2,.CopyForwardLoop
	bra.s	.DecompLoop

.CopyBackward:
	andi.w	#$7F,d2
	addq.w	#2,d2
	move.w	d0,d3
	sub.b	(a0)+,d3
	subq.b	#1,d3

.CopyBackwardLoop:
	move.b	(a1,d3.w),d4
	move.b	d4,(a2,d1.w)

	addq.b	#1,d1
	btst	#2,d1
	beq.w	.CopyBackwardStore
	clr.b	d1
	move.l	(a2),VDP_DATA

.CopyBackwardStore:
	move.b	d4,(a1,d0.w)

	addq.b	#1,d0
	addq.b	#1,d3
	dbf	d2,.CopyBackwardLoop
	bra.s	.DecompLoop

