; --------------------------------------------------------------
; Palette fade actor variables
; --------------------------------------------------------------

pfLine		EQU	$08
pfData		EQU	$0E
pfFlag		EQU	$12
pfTimer		EQU	$26
pfSpeed		EQU	$28
pfSteps		EQU	$2A

; --------------------------------------------------------------
; Fade to palette with an amount of steps
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- Palette line
;	d1.b	- Fade speed
;	d2.b	- Step count
;	a2.l	- Target palette
; --------------------------------------------------------------

FadeToPal_StepCount:
	lea	ActPalFade,a1
	bsr.w	FindActorSlot
	bcc.w	.Spawned
	rts

.Spawned:
	andi.b	#7,d2
	addq.b	#1,d2
	move.b	d2,pfSteps+1(a1)
	bra.w	FadeToPal_Setup

; --------------------------------------------------------------
; Fade to palette
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- Palette line
;	d1.b	- Fade speed
;	a2.l	- Target palette
; --------------------------------------------------------------

FadeToPalette:
	lea	ActPalFade,a1
	bsr.w	FindActorSlot
	bcc.w	.Spawned
	rts

.Spawned:
	move.w	#8,pfSteps(a1)

; --------------------------------------------------------------

FadeToPal_Setup:
	andi.w	#3,d0
	move.w	d0,pfLine(a1)
	move.b	d1,pfSpeed+1(a1)

	mulu.w	#$82,d0
	lea	pal_fade_data,a3
	adda.l	d0,a3
	move.l	a3,pfData(a1)

	addq.w	#1,(a3)
	move.w	(a3),pfFlag(a1)

	movem.l	a2,-(sp)

	clr.l	d0
	move.w	pfLine(a1),d0
	lsl.l	#5,d0
	lea	palette_buffer,a2
	adda.l	d0,a2
	adda.l	#2,a3
	bsr.w	ActPalFade_Split

	movem.l	(sp)+,a2

	movea.l	pfData(a1),a3
	adda.l	#$32,a3
	bsr.w	ActPalFade_Split
	bsr.w	ActPalFade_GetAccums
	rts

; --------------------------------------------------------------
; Palette fade actor
; --------------------------------------------------------------

ActPalFade:
	move.w	pfFlag(a0),d0
	movea.l	pfData(a0),a2
	cmp.w	(a2),d0
	bne.w	ActorDeleteSelf

	addq.w	#1,pfTimer(a0)
	move.w	pfSpeed(a0),d0
	cmp.w	pfTimer(a0),d0
	bcs.w	.DoFade
	rts

.DoFade:
	clr.w	pfTimer(a0)
	bsr.w	ActPalFade_DoFade
	subq.w	#1,pfSteps(a0)
	beq.w	.Done
	rts

.Done:
	movea.l	pfData(a0),a2
	clr.w	(a2)
	bra.w	ActorDeleteSelf

; --------------------------------------------------------------
; Perform palette fading
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to palette fade actor data
; --------------------------------------------------------------

ActPalFade_DoFade:
	movea.l	pfData(a0),a2
	movea.l	a2,a3
	adda.l	#2,a2
	adda.l	#$32,a3

	move.w	#($10*3)-1,d0

.Fade:
	move.b	(a3,d0.w),d1
	add.b	d1,(a2,d0.w)
	dbf	d0,.Fade

	adda.l	#$30,a3
	bsr.w	ActPalFade_GetMDPal

	movea.l	pfData(a0),a2
	adda.l	#$62,a2
	move.w	pfLine(a0),d0
	bra.w	LoadPalette

; --------------------------------------------------------------
; Get accumulators for palette fading
; --------------------------------------------------------------
; PARAMETERS:
;	a1.l	- Pointer to palette fade actor slot
; --------------------------------------------------------------

ActPalFade_GetAccums:
	movea.l	pfData(a1),a2
	movea.l	a2,a3
	adda.l	#2,a2
	adda.l	#$32,a3

	move.w	#($10*3)-1,d0

.GetAccums:
	move.b	(a3),d1
	sub.b	(a2)+,d1
	asr.b	#3,d1
	move.b	d1,(a3)+

	dbf	d0,.GetAccums
	rts

; --------------------------------------------------------------
; Split palette for fading
; --------------------------------------------------------------
; PARAMETERS:
;	a2.l	- Palette buffer
;	a3.l	- Palette fade data color buffer
; --------------------------------------------------------------

ActPalFade_Split:
	move.w	#$10-1,d0

.Split:
	move.b	(a2)+,d1
	lsl.b	#3,d1
	andi.b	#$70,d1
	move.b	d1,(a3)+
	
	move.b	(a2),d1
	lsl.b	#3,d1
	andi.b	#$70,d1
	move.b	d1,(a3)+
	
	move.b	(a2)+,d1
	lsr.b	#1,d1
	andi.b	#$70,d1
	move.b	d1,(a3)+

	dbf	d0,.Split
	rts

; --------------------------------------------------------------
; Get Mega Drive compatible palette from palette fade data
; --------------------------------------------------------------
; PARAMETERS:
;	a2.l	- Palette fade data color buffer
;	a3.l	- Palette buffer
; --------------------------------------------------------------

ActPalFade_GetMDPal:
	move.w	#$10-1,d0

.Combine:
	bsr.w	ActPalFade_GetColChannel
	lsr.b	#3,d1
	andi.b	#$E,d1
	move.b	d1,(a3)+

	bsr.w	ActPalFade_GetColChannel
	move.b	d1,d2
	lsr.b	#3,d2
	andi.b	#$E,d2
	
	bsr.w	ActPalFade_GetColChannel
	lsl.b	#1,d1
	andi.b	#$E0,d1
	or.b	d2,d1
	move.b	d1,(a3)+

	dbf	d0,.Combine
	rts

; --------------------------------------------------------------
; Get color channel from palette fade data
; --------------------------------------------------------------
; PARAMETERS:
;	a2.l	- Palette fade data color buffer
; --------------------------------------------------------------

ActPalFade_GetColChannel:
	move.b	(a2)+,d1
	btst	#1,d1
	beq.w	.End
	addq.b	#4,d1

.End:
	rts

; --------------------------------------------------------------
; Initialize the palette buffer (interrupt safe)
; --------------------------------------------------------------

InitPalette_Safe:
	DISABLE_INTS

	bsr.w	InitPalette

	ENABLE_INTS
	rts

; --------------------------------------------------------------
; Initialize the palette buffer
; --------------------------------------------------------------

InitPalette:
	moveq	#0,d0
	lea	palette_buffer,a2
	move.w	#$80/4-1,d1

.ClearPal:
	move.l	d0,(a2)+
	dbf	d1,.ClearPal

; --------------------------------------------------------------
; Initialize the palette pointer list
; --------------------------------------------------------------

InitPalettePtrs2:
	lea	palette_pointers,a2

	move.w	#-1,(a2)+
	move.l	#palette_buffer,(a2)+
	move.w	#-1,(a2)+
	move.l	#palette_buffer+$20,(a2)+
	move.w	#-1,(a2)+
	move.l	#palette_buffer+$40,(a2)+
	move.w	#-1,(a2)+
	move.l	#palette_buffer+$60,(a2)+

	rts

; --------------------------------------------------------------
; Invert the palette
; --------------------------------------------------------------

InvertPalette:
	lea	palette_buffer,a2
	move.w	#$80/2-1,d0

.InvertLoop:
	move.w	(a2),d1
	eori.w	#$EEE,d1
	move.w	d1,(a2)+

	dbf	d0,.InvertLoop
	bra.s	InitPalettePtrs2

; --------------------------------------------------------------
; Load a palette
; --------------------------------------------------------------
; PARAMETERS
;	d0.w	- Palette line
;	a2.l	- Pointer to palette data
; --------------------------------------------------------------

LoadPalette:
	movem.l	d1/a3,-(sp)
	
	andi.w	#3,d0
	lsl.w	#1,d0
	move.w	d0,d1
	lsl.w	#1,d0
	add.w	d1,d0

	lea	palette_pointers,a3
	move.l	a2,2(a3,d0.w)
	move.w	#-1,(a3,d0.w)

	movem.l	(sp)+,d1/a3
	rts

; --------------------------------------------------------------
; Initialize controllers
; --------------------------------------------------------------

InitControllers:
	lea	p1_ctrl_hold,a1
	moveq	#0,d0
	move.l	d0,(a1)+
	move.l	d0,(a1)+
	move.l	d0,(a1)+
	move.b	#$10,pressed_time
	move.b	#3,unpressed_time

	Z80_STOP
	moveq	#$40,d0
	move.b	d0,PORT_A_CTRL
	move.b	d0,PORT_B_CTRL
	move.b	d0,PORT_C_CTRL
	Z80_START

	rts

; --------------------------------------------------------------
; Read controllers (interrupt and Z80 safe)
; --------------------------------------------------------------

ReadCtrls_Safe:
	DISABLE_INTS
	Z80_STOP

	bsr.w	ReadControllers

	Z80_START
	ENABLE_INTS
	rts

; --------------------------------------------------------------
; Read controllers
; --------------------------------------------------------------

ReadControllers:
	lea	p1_ctrl_hold,a0
	lea	PORT_A_DATA,a1
	bsr.w	ReadController
	lea	p2_ctrl_hold,a0
	lea	PORT_B_DATA,a1

; --------------------------------------------------------------
; Read a controller
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to controller read buffer
;	a1.l	- Pointer to I/O data port
; --------------------------------------------------------------

ReadController:
	move.b	#0,(a1)
	nop
	nop
	move.b	(a1),d1
	move.b	d1,d2
	asl.b	#2,d1
	andi.b	#$C0,d1
	move.b	#$40,(a1)
	nop
	nop
	move.b	(a1),d0
	andi.b	#$3F,d0
	or.b	d1,d0
	not.b	d0
	andi.b	#$C,d2
	beq.w	.Not6Button
	andi.b	#$CF,d0

.Not6Button:
	move.b	0(a0),d1
	move.b	d0,0(a0)
	move.b	0(a0),1(a0)
	not.b	d1
	and.b	d1,1(a0)

	bsr.w	CtrlVertiTimes
	bsr.w	CtrlHorizTimes
	rts

; --------------------------------------------------------------
; Handle button press timers for left and right
; --------------------------------------------------------------

CtrlHorizTimes:
	andi.b	#$F3,2(a0)
	move.b	0(a0),d0
	move.b	3(a0),d1
	move.b	d1,d2
	ror.b	#4,d1
	eor.b	d0,d1
	andi.b	#$C,d1
	bne.s	.Pressed
	andi.b	#$3F,d2
	beq.s	.Unpressed
	subq.b	#1,3(a0)
	rts

.Unpressed:
	andi.b	#$C,d0
	or.b	d0,2(a0)
	move.b	unpressed_time,d0
	or.b	d0,3(a0)
	rts

.Pressed:
	andi.b	#$C,d0
	or.b	d0,2(a0)
	rol.b	#4,d0
	andi.b	#$C0,d0
	or.b	pressed_time,d0
	move.b	d0,3(a0)
	rts

; --------------------------------------------------------------
; Handle button press timers for up and down
; --------------------------------------------------------------

CtrlVertiTimes:
	andi.b	#$FC,2(a0)
	move.b	0(a0),d0
	move.b	4(a0),d1
	move.b	d1,d2
	ror.b	#6,d1
	eor.b	d0,d1
	andi.b	#3,d1
	bne.s	.Pressed
	andi.b	#$3F,d2
	beq.s	.Unpressed
	subq.b	#1,4(a0)
	rts

.Unpressed:
	andi.b	#3,d0
	or.b	d0,2(a0)
	move.b	unpressed_time,d0
	or.b	d0,4(a0)
	rts

.Pressed:
	andi.b	#3,d0
	or.b	d0,2(a0)
	rol.b	#6,d0
	andi.b	#$C0,d0
	or.b	pressed_time,d0
	move.b	d0,4(a0)
	rts

; --------------------------------------------------------------
; Generate a random number
; --------------------------------------------------------------
; RETURNS:
;	d0.l	- Random number
; --------------------------------------------------------------

Random:
	movem.l	d1,-(sp)

	move.l	rng_seed,d1
	bne.s	.GotSeed
	move.l	#$2A6D365A,d1

.GotSeed:
	move.l	d1,d0
	asl.l	#2,d1
	add.l	d0,d1
	asl.l	#3,d1
	add.l	d0,d1
	move.w	d1,d0
	swap	d1
	add.w	d1,d0
	move.w	d0,d1
	swap	d1
	move.l	d1,rng_seed

	movem.l	(sp)+,d1
	rts

; --------------------------------------------------------------
; Generate a random number within a boundary
; --------------------------------------------------------------
; PARAMETERS:
;	d1.w	- Exlusive boundary
; RETURNS:
;	d0.l	- Random number
; --------------------------------------------------------------

RandomBound:
	movem.l	d1,-(sp)

	move.l	d0,d1
	bsr.s	Random
	mulu.w	d1,d0
	swap	d0

	movem.l	(sp)+,d1
	rts

; --------------------------------------------------------------
; Get the cosine of a value
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- Value
;	d1.w	- Multiplier
; RETURNS:
;	d0.l	- The cosine of the input value
; --------------------------------------------------------------

Cos:
	addi.b	#$40,d0

; --------------------------------------------------------------
; Get the sine of a value
; --------------------------------------------------------------
; PARAMETERS:
;	d0.w	- Value
;	d1.w	- Multiplier
; RETURNS:
;	d0.l	- The sine of the input value
; --------------------------------------------------------------

Sin:
	movem.w	d0,-(sp)

	andi.w	#$7F,d0
	lsl.w	#1,d0
	move.w	SineTable(pc,d0.w),d2
	mulu.w	d1,d2

	movem.w	(sp)+,d0

	or.b	d0,d0
	bpl.w	.End
	neg.l	d2

.End:
	rts
	
; --------------------------------------------------------------
; Sine table
; --------------------------------------------------------------

SineTable:
	dc.w	$0000, $0006, $000D, $0013, $0019, $001F, $0026, $002C
	dc.w	$0032, $0038, $003E, $0044, $004A, $0050, $0056, $005C
	dc.w	$0062, $0068, $006D, $0073, $0079, $007E, $0084, $0089
	dc.w	$008E, $0093, $0098, $009D, $00A2, $00A7, $00AC, $00B1
	dc.w	$00B5, $00B9, $00BE, $00C2, $00C6, $00CA, $00CE, $00D1
	dc.w	$00D5, $00D8, $00DC, $00DF, $00E2, $00E5, $00E7, $00EA
	dc.w	$00ED, $00EF, $00F1, $00F3, $00F5, $00F7, $00F8, $00FA
	dc.w	$00FB, $00FC, $00FD, $00FE, $00FF, $00FF, $0100, $0100
	dc.w	$0100, $0100, $0100, $00FF, $00FF, $00FE, $00FD, $00FC
	dc.w	$00FB, $00FA, $00F8, $00F7, $00F5, $00F3, $00F1, $00EF
	dc.w	$00ED, $00EA, $00E7, $00E5, $00E2, $00DF, $00DC, $00D8
	dc.w	$00D5, $00D1, $00CE, $00CA, $00C6, $00C2, $00BE, $00B9
	dc.w	$00B5, $00B1, $00AC, $00A7, $00A2, $009D, $0098, $0093
	dc.w	$008E, $0089, $0084, $007E, $0079, $0073, $006D, $0068
	dc.w	$0062, $005C, $0056, $0050, $004A, $0044, $003E, $0038
	dc.w	$0032, $002C, $0026, $001F, $0019, $0013, $000D, $0006

; --------------------------------------------------------------
; Leftover code from Puyo Puyo that applied the swirling
; effect on the clouds in Satan's introduction scene
; --------------------------------------------------------------

SpawnSatanCloudEffects:
	lea	ActSatanCloudEffects,a1
	bsr.w	FindActorSlot
	bcc.w	@Spawned
	rts

@Spawned:
	move.w	#$8B00,d0
	move.b	vdp_reg_b,d0
	ori.b	#3,d0
	move.b	d0,vdp_reg_b
	rts

; --------------------------------------------------------------

ActSatanCloudEffects:
	lea	hscroll_buffer+(112*4),a2
	move.b	aField36(a0),d0
	clr.w	d1
	move.w	#$6F,d4
	move.w	vscroll_buffer+2,d3
	subi.w	#-$A1,d3
	bcs.w	loc_157A
	cmpi.w	#$70,d3
	bcc.w	loc_1596
	sub.w	d3,d4

.Clear:
	clr.w	-(a2)
	clr.w	-(a2)
	dbf	d3,.Clear
	subq.w	#1,d4
	bcc.w	loc_157A
	rts

loc_157A:
	bsr.w	Sin
	swap	d2
	asl.w	#1,d2
	move.w	d2,-(a2)
	clr.w	-(a2)
	addq.b	#2,d0
	addi.w	#$100,d1
	dbf	d4,loc_157A
	addq.b	#1,aField36(a0)
	rts

loc_1596:
	move.w	#$8B00,d0
	move.b	vdp_reg_b,d0
	andi.b	#$FC,d0
	move.b	d0,vdp_reg_b
	clr.b	byte_FF0136
	clr.w	hscroll_buffer+2
	bra.w	ActorDeleteSelf

	rts
	rts

; --------------------------------------------------------------
; Initialize bytecode
; --------------------------------------------------------------

InitBytecode:
	move.l	#Bytecode,bytecode_addr
	clr.b	bytecode_flag
	clr.b	bytecode_disabled
	rts

; --------------------------------------------------------------
; Run bytecode
; --------------------------------------------------------------

RunBytecode:
	tst.b	bytecode_disabled
	beq.w	.Run
	rts

.Run:
	clr.b	bytecode_done

	movea.l	bytecode_addr,a0
	move.w	(a0)+,d1
	move.w	(a0)+,d0
	move.l	a0,bytecode_addr

	asl.w	#2,d1
	movea.l	.Instructions(pc,d1.w),a0
	jsr	(a0)

	tst.b	bytecode_done
	beq.s	.Run
	rts

; --------------------------------------------------------------

.Instructions:
	dc.l	Bytecode_Disable
	dc.l	Bytecode_FrameDone
	dc.l	Bytecode_Delay
	dc.l	Bytecode_WaitPalFade
	dc.l	Bytecode_Write
	dc.l	Bytecode_RunCode
	dc.l	Bytecode_Jump
	dc.l	Bytecode_JumpIfClear
	dc.l	Bytecode_JumpIfSet
	dc.l	Bytecode_JumpTable
	dc.l	Bytecode_VDPRegs
	dc.l	Bytecode_PuyoDec
	dc.l	Bytecode_PlaneCmdList
	dc.l	Bytecode_LoadPal
	dc.l	Bytecode_FadePal
	dc.l	Bytecode_PlaySound
	dc.l	Bytecode_PlaySnd_ChkPCM
	dc.l	Bytecode_FadeSound
	dc.l	Bytecode_StopSound
	dc.l	Bytecode_PlaySnd_ChkPCM2
	dc.l	Bytecode_NemDec
	dc.l	Bytecode_FadePal_Intro
	dc.l	Bytecode_PuyoDec_Intro

; --------------------------------------------------------------
; Disable bytecode
; --------------------------------------------------------------

Bytecode_Disable:
	subq.l	#2,bytecode_addr
	move.b	#-1,bytecode_done
	move.b	#-1,bytecode_disabled
	rts

; --------------------------------------------------------------
; Stop running bytecode for this frame
; --------------------------------------------------------------

Bytecode_FrameDone:
	subq.l	#2,bytecode_addr
	move.b	#-1,bytecode_done
	rts

; --------------------------------------------------------------
; Delay running bytecode for a number of frames
; --------------------------------------------------------------
; PARAMETERS:
;	$00.w	- Number of frames to delay for
; --------------------------------------------------------------

Bytecode_Delay:
	move.b	#-1,bytecode_done
	move.b	#-1,bytecode_disabled

	lea	ActBytecodeDelay,a1
	bsr.w	FindActorSlot
	bcc.w	.Spawned
	rts

.Spawned:
	move.w	d0,aDelay(a1)
	rts

; --------------------------------------------------------------
; Bytecode delay actor
; --------------------------------------------------------------

ActBytecodeDelay:
	bsr.w	ActorBookmark

.Done:
	clr.b	bytecode_disabled
	bra.w	ActorDeleteSelf

; --------------------------------------------------------------
; Wait for a palette fade to end
; --------------------------------------------------------------

Bytecode_WaitPalFade:
	subq.l	#2,bytecode_addr
	move.b	#-1,bytecode_done
	move.b	#-1,bytecode_disabled

	lea	ActWaitPalFade,a1
	bra.w	FindActorSlot

; --------------------------------------------------------------
; Palette fade wait actor
; --------------------------------------------------------------

ActWaitPalFade:
	bsr.w	CheckPaletteFade
	bcc.w	.Done
	rts

.Done:
	clr.b	bytecode_disabled
	bra.w	ActorDeleteSelf

; --------------------------------------------------------------
; Check if a palette fade is occurring
; --------------------------------------------------------------
; RETURNS:
;	cc/cs	- Not occurring/Occurring
; --------------------------------------------------------------

CheckPaletteFade:
	lea	pal_fade_data,a2
	move.w	#4-1,d0

.LineCheck:
	tst.w	(a2)
	bne.w	.IsFading

	adda.l	#$82,a2
	dbf	d0,.LineCheck

	CLEAR_CARRY
	rts

.IsFading:
	SET_CARRY
	rts
	
; --------------------------------------------------------------
; Write a word to an address
; --------------------------------------------------------------
; PARAMETERS:
;	00.l	- Destination address
;	04.w	- Value to write
; --------------------------------------------------------------

Bytecode_Write:
	movea.l	bytecode_addr,a0
	swap	d0
	move.w	(a0)+,d0
	move.w	(a0)+,d1
	move.l	a0,bytecode_addr
	movea.l	d0,a0

	move.w	d1,(a0)
	rts

; --------------------------------------------------------------
; Run code
; --------------------------------------------------------------
; PARAMETERS:
;	00.l	- Code address
; --------------------------------------------------------------

Bytecode_RunCode:
	movea.l	bytecode_addr,a0
	swap	d0
	move.w	(a0)+,d0
	move.l	a0,bytecode_addr
	movea.l	d0,a0

	jmp	(a0)

; --------------------------------------------------------------
; Jump to an address in bytecode
; --------------------------------------------------------------
; PARAMETERS:
;	00.l	- Jump address
; --------------------------------------------------------------

Bytecode_Jump:
	movea.l	bytecode_addr,a0
	swap	d0
	move.w	(a0),d0

	move.l	d0,bytecode_addr
	rts

; --------------------------------------------------------------
; Jump to an address in bytecode if the bytecode flag is clear
; --------------------------------------------------------------
; PARAMETERS:
;	00.l	- Jump address
; --------------------------------------------------------------

Bytecode_JumpIfClear:
	tst.b	bytecode_flag
	beq.s	Bytecode_Jump

	addq.l	#2,bytecode_addr
	rts

; --------------------------------------------------------------
; Jump to an address in bytecode if the bytecode flag is set
; --------------------------------------------------------------
; PARAMETERS:
;	00.l	- Jump address
; --------------------------------------------------------------

Bytecode_JumpIfSet:
	tst.b	bytecode_flag
	bne.s	Bytecode_Jump

	addq.l	#2,bytecode_addr
	rts

; --------------------------------------------------------------
; Jump to an address in bytecode from a table using the
; bytecode flag as an index
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- Number of addresses
;	02.l	- Address 1
;	06.l	- Address 2
;	NN.l	- Address N
; --------------------------------------------------------------

Bytecode_JumpTable:
	movea.l	bytecode_addr,a0

	clr.w	d1
	move.b	bytecode_flag,d1

	cmp.w	d0,d1
	bcs.w	.Jump
	move.w	d0,d1
	subq.w	#1,d1

.Jump:
	lsl.w	#2,d1
	move.l	(a0,d1.w),d2
	move.l	d2,bytecode_addr
	rts

; --------------------------------------------------------------
; Set up VDP registers
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- VDP register table ID
; --------------------------------------------------------------

Bytecode_VDPRegs:
	bra.w	SetupVDPRegs_DisplayOn

; --------------------------------------------------------------
; Decompress Puyo compressed art
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- VRAM address
;	02.l	- Pointer to compressed art
; --------------------------------------------------------------

Bytecode_PuyoDec:
	movea.l	bytecode_addr,a1
	movea.l	(a1)+,a0
	move.l	a1,bytecode_addr

	bra.w	PuyoDec

; --------------------------------------------------------------
; Decompress Puyo compressed art (also checks if the Robotnik
; intro cutscene is active, and if so, it forces the VRAM
; address to be $2000)
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- VRAM address
;	02.l	- Pointer to compressed art
; --------------------------------------------------------------

Bytecode_PuyoDec_Intro:
	cmpi.b	#$F,level
	bne.s	.NotRobotnik
	move.w	#$2000,d0

.NotRobotnik:
	movea.l	bytecode_addr,a1
	movea.l	(a1)+,a0
	move.l	a1,bytecode_addr

	bra.w	PuyoDec

; --------------------------------------------------------------
; Decompress Nemesis compressed art
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- VRAM address
;	02.l	- Pointer to compressed art
; --------------------------------------------------------------

Bytecode_NemDec:
	movea.l	bytecode_addr,a1
	movea.l	(a1)+,a0
	move.l	a1,bytecode_addr

	DISABLE_INTS
	jsr	NemDec
	ENABLE_INTS
	rts

; --------------------------------------------------------------
; Queue a plane command list
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- Plane command list ID
; --------------------------------------------------------------

Bytecode_PlaneCmdList:
	bra.w	QueuePlaneCmdList

; --------------------------------------------------------------
; Fade to palette
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- Palette table offset/Palette line
;	02.b	- Fade speed
;	03.b	- Unused
; --------------------------------------------------------------

Bytecode_FadePal:
	move.b	d0,d1
	lsr.w	#3,d0
	andi.l	#$1FFF,d0
	lea	Palettes,a2
	adda.l	d0,a2

	move.b	d1,d0
	movea.l	bytecode_addr,a0
	move.b	(a0)+,d1
	move.b	(a0)+,d2
	move.l	a0,bytecode_addr

	bra.w	FadeToPalette

; --------------------------------------------------------------
; Fade to palette (also checks if the Robotnik intro cutscene
; is active, and if so, use the alternate palette)
; --------------------------------------------------------------
; PARAMETERS:
;	00.w	- Palette table offset/Palette line
;	02.b	- Fade speed
;	03.b	- Alternate palette table offset
;
;	[Robotnik intro cutscene active]
;	00.w	- Palette line
;	02.b	- Fade speed
;	03.b	- Palette table ID
; --------------------------------------------------------------

Bytecode_FadePal_Intro:
	tst.b	use_lair_background
	bne.s	.RobotniksLair

	move.b	d0,d1
	lsr.w	#3,d0
	andi.l	#$1FFF,d0
	move.w	d0,d3
	lea	Palettes,a2
	adda.l	d0,a2

	move.b	d1,d0
	movea.l	bytecode_addr,a0
	move.b	(a0)+,d1
	move.b	(a0)+,d2
	move.l	a0,bytecode_addr

	tst.w	d3
	beq.s	.End
	bra.w	FadeToPalette

.End:
	rts

.RobotniksLair:
	moveq	#0,d2
	movea.l	bytecode_addr,a0
	move.b	(a0)+,d1
	move.b	(a0)+,d2
	move.l	a0,bytecode_addr

	lea	Palettes,a2
	asl.w	#5,d2
	adda.w	d2,a2

	bra.w	FadeToPalette

; --------------------------------------------------------------
; Load a palette
; --------------------------------------------------------------
; PARAMETERS
;	00.w	- Palette table offset/Palette line
; --------------------------------------------------------------

Bytecode_LoadPal:
	move.b	d0,d1
	lsr.w	#3,d0
	andi.l	#$1FFF,d0
	lea	Palettes,a2
	adda.l	d0,a2
	move.b	d1,d0

	bra.w	LoadPalette

; --------------------------------------------------------------
; Play a sound
; --------------------------------------------------------------
; PARAMETERS
;	00.w	- Sound ID
; --------------------------------------------------------------

Bytecode_PlaySound:
	jmp	JmpTo_PlaySound

; --------------------------------------------------------------
; Play a sound (checks if PCM is enabled)
; --------------------------------------------------------------
; PARAMETERS
;	00.w	- Sound ID
; --------------------------------------------------------------

Bytecode_PlaySnd_ChkPCM:
	jmp	PlaySound_ChkPCM

; --------------------------------------------------------------
; Fade out sound
; --------------------------------------------------------------

Bytecode_FadeSound:
	subq.l	#2,bytecode_addr
	jmp	FadeSound

; --------------------------------------------------------------
; Stop all sounds
; --------------------------------------------------------------

Bytecode_StopSound:
	subq.l	#2,bytecode_addr
	jmp	StopSound

; --------------------------------------------------------------
; Play a sound (checks if PCM is enabled)
; --------------------------------------------------------------
; PARAMETERS
;	00.w	- Sound ID
; --------------------------------------------------------------

Bytecode_PlaySnd_ChkPCM2:
	jmp	PlaySound_ChkPCM

