; --------------------------------------------------------------
; Initialize actors
; --------------------------------------------------------------

InitActors:
	move.w	#(actors_end-actors)/4-1,d1
	lea	actors,a0
	moveq	#0,d0

.ClearActors:
	move.l	d0,(a0)+
	dbf	d1,.ClearActors

	lea	pal_fade_data,a2
	move.w	#4-1,d0

.ClearPalFade:
	clr.w	(a2)
	adda.l	#$82,a2
	dbf	d0,.ClearPalFade

	rts

; --------------------------------------------------------------
; Run actors
; --------------------------------------------------------------

RunActors:
	move.b	player_1_flags,d0
	rol.b	#1,d0
	andi.b	#1,d0
	eori.b	#1,d0
	move.b	player_2_flags,d1
	rol.b	#2,d1
	andi.b	#2,d1
	eori.b	#2,d1
	or.b	d0,d1
	ori.b	#$C,d1

	lea	actors,a0
	move.w	#(actors_end-actors)/aSize-1,d0

.ActorLoop:
	move.b	aField0(a0),d2
	and.b	d1,d2
	beq.w	.NextActor

	movem.l	d0-d1,-(sp)
	movea.l	aAddr(a0),a1
	jsr	(a1)
	movem.l	(sp)+,d0-d1

.NextActor:
	adda.l	#aSize,a0
	dbf	d0,.ActorLoop

	rts

; --------------------------------------------------------------
; Find and initialize an actor slot
; --------------------------------------------------------------
; PARAMETERS:
;	d0.b	- Initial flags
;	a1.l	- Pointer to actor code
; RETURNS:
;	a1.l	- Pointer to actor slot
; --------------------------------------------------------------

FindActorSlot:
	bsr.w	FindActorSlotQuick
	bcc.w	.Loaded
	movem.l	d0/a0,-(sp)

	lea	actors,a0
	move.w	#(actors_end-actors)/aSize-1,d0

.FindSlot:
	btst	#7,aField1(a0)
	beq.w	.FoundSlot
	adda.l	#aSize,a0
	dbf	d0,.FindSlot

	movem.l	(sp)+,d0/a0
	SET_CARRY
	rts

.FoundSlot:
	move.l	a1,aAddr(a0)
	movea.l	a0,a1
	adda.l	#aDrawFlags,a0
	move.w	#(aSize-aDrawFlags)/2-1,d0

.ClearSlot:
	move.w	#0,(a0)+
	dbf	d0,.ClearSlot
	movem.l	(sp)+,d0/a0

.Loaded:
	ori.b	#$80,aField1(a1)
	CLEAR_CARRY
	rts

; --------------------------------------------------------------
; Find and initialize an actor slot (quick)
; --------------------------------------------------------------
; PARAMETERS:
;	d0.b	- Initial flags
;	a1.l	- Pointer to actor code
; RETURNS:
;	a1.l	- Pointer to actor slot
; --------------------------------------------------------------

FindActorSlotQuick:
	movem.l	d0/a0,-(sp)

	lea	actors,a0
	move.w	#(actors_end-actors)/aSize-1,d0

.FindSlot:
	tst.w	aField0(a0)
	beq.w	.FoundSlot
	adda.l	#aSize,a0
	dbf	d0,.FindSlot

	movem.l	(sp)+,d0/a0
	SET_CARRY
	rts

.FoundSlot:
	ori.w	#$FF00,d0
	move.w	d0,aField0(a0)
	move.l	a1,aAddr(a0)
	movea.l	a0,a1

	movem.l	(sp)+,d0/a0
	CLEAR_CARRY
	rts

; --------------------------------------------------------------
; Have an actor delete itself
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorDeleteSelf:
	movem.l	a2,-(sp)
	movea.l	a0,a2
	bra.w	DeleteActor

; --------------------------------------------------------------
; Delete an actor
; --------------------------------------------------------------
; PARAMETERS:
;	a1.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorDeleteOther:
	movem.l	a2,-(sp)
	movea.l	a1,a2

; --------------------------------------------------------------
; Delete an actor
; --------------------------------------------------------------
; PARAMETERS:
;	a2.l	- Pointer to actor slot
; --------------------------------------------------------------

DeleteActor:
	movem.l	d0-d1,-(sp)

	moveq	#0,d0
	move.w	#aSize/4-1,d1

.Clear:
	move.l	d0,(a2)+
	dbf	d1,.Clear

	movem.l	(sp)+,d0-d1
	movem.l	(sp)+,a2
	rts

; --------------------------------------------------------------
; Set a bookmark in an actor's code and set delay timer
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorBookmark_SetDelay:
	move.w	d0,aDelay(a0)
	move.l	(sp)+,aAddr(a0)
	rts

; --------------------------------------------------------------
; Set a bookmark in an actor's code (with delay timer)
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorBookmark:
	tst.w	aDelay(a0)
	beq.w	.Bookmark
	subq.w	#1,aDelay(a0)
	beq.w	.Bookmark
	move.l	(sp)+,d0
	rts

.Bookmark:
	move.l	(sp)+,aAddr(a0)
	rts

; --------------------------------------------------------------
; Set a bookmark in an actor's code (with delay timer and
; controller checks for bypassing the delay)
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorBookmark_Ctrl:
	move.b	p1_ctrl_press,d0
	or.b	p2_ctrl_press,d0
	andi.b	#$F0,d0
	bne.w	.Bookmark

	tst.w	aDelay(a0)
	beq.w	.Bookmark
	subq.w	#1,aDelay(a0)
	beq.w	.Bookmark
	move.l	(sp)+,d0
	rts

.Bookmark:
	clr.w	aDelay(a0)
	move.l	(sp)+,aAddr(a0)
	rts

; --------------------------------------------------------------
; Process an actor's animation script
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
; --------------------------------------------------------------

ActorAnimate:
	tst.b	aAnimTime(a0)
	beq.w	.ChkStop
	subq.b	#1,aAnimTime(a0)
	rts

.ChkStop:
	movea.l	aAnim(a0),a2
	cmpi.b	#$FE,(a2)
	bcs.w	ActorParseAnim
	bne.w	.Jump

	SET_CARRY
	rts

.Jump:
	movea.l	2(a2),a3
	movea.l	a3,a2
	bsr.w	ActorParseAnim

	SET_CARRY
	rts

; --------------------------------------------------------------
; Parse an actor's animation script
; --------------------------------------------------------------
; PARAMETERS:
;	a0.l	- Pointer to actor slot
;	a2.l	- Pointer to animation script
; --------------------------------------------------------------

ActorParseAnim:
	move.b	(a2)+,d0
	cmpi.b	#$F0,d0
	bcs.w	.GetFrame
	bsr.w	ActorRandomAnimTime

.GetFrame:
	move.b	d0,aAnimTime(a0)
	move.b	(a2)+,d0
	move.b	d0,aFrame(a0)

	move.l	a2,aAnim(a0)
	CLEAR_CARRY
	rts

; --------------------------------------------------------------
; Get a random animation frame time
; --------------------------------------------------------------
; PARAMETERS:
;	d0.b	- Random time array ID
; RETURNS:
;	d0.b	- Random time
; --------------------------------------------------------------

ActorRandomAnimTime:
	clr.w	d1
	move.b	d0,d1
	lsl.b	#3,d1
	andi.b	#$38,d1

	bsr.w	Random
	andi.b	#7,d0

	clr.w	d2
	move.b	d0,d2
	add.w	d1,d2
	move.b	.AnimTimes(pc,d2.w),d0

	SET_CARRY
	rts

; --------------------------------------------------------------

.AnimTimes:
	dc.b	$30, $60, $02, $6C, $40, $46, $50, $5C
	dc.b	$30, $60, $20, $6C, $40, $46, $50, $5C
	dc.b	$00, $00, $00, $00, $00, $46, $50, $5C
	dc.b	$80, $A0, $60, $78, $BD, $AA, $B4, $C0
	dc.b	$00, $00, $00, $00, $20, $10, $0C, $30
	dc.b	$30, $60, $00, $6C, $40, $46, $50, $5C
	dc.b	$30, $60, $00, $6C, $40, $46, $50, $5C
	dc.b	$30, $60, $00, $6C, $40, $46, $50, $5C

