; --------------------------------------------------------------
; Initialize sound
; --------------------------------------------------------------

InitSound:
	jsr	LoadCubeDriver
	jsr	InitSoundQueue
	move.b	d0,sound_playing
	rts

; --------------------------------------------------------------
; Load the Cube sound driver
; --------------------------------------------------------------

LoadCubeDriver:
	move.w	#$100,Z80_BUS
	move.w	#0,Z80_RESET
	rept	14
		nop
	endr
	move.w	#$100,Z80_RESET

.WaitStop:
	btst	#0,Z80_BUS
	bne.s	.WaitStop

	Z80_STOP
	move.w	#$100,Z80_RESET
	rept	14
		nop
	endr

	lea	CubeDriver,a0
	lea	ZRAM_START,a1
	move.w	#CubeDriver_End-CubeDriver-1,d7

.LoadDriver:
	move.b	(a0)+,(a1)+
	dbf	d7,.LoadDriver

	move.w	#0,Z80_RESET
	Z80_START
	move.w	#$100,Z80_RESET
	rept	14
		nop
	endr

	rts

; --------------------------------------------------------------
; Update sound
; --------------------------------------------------------------

UpdateSound:
		moveq	#0,d0
		move.b	(sound_playing).l,d0
		bne.s	.DoPlay
		jsr	(ProcessSoundQueue).l
		move.b	d0,(sound_playing).l
		beq.s	.End

.DoPlay:
		move.w	#$100,Z80_BUS

.StopZ80:
		nop
		nop
		nop
		nop
		btst	#0,Z80_BUS
		bne.s	.StopZ80
		move.b	ZRAM_START+$1FFF,d1
		bne.s	.Active
		move.b	d0,ZRAM_START+$1FFF
		move.b	unk_8660(pc,d0.w),d1
		beq.s	.NoSound
		move.b	d1,ZRAM_START+$1FFE

.NoSound:
		move.b	#0,(sound_playing).l

.Active:
		move.w	#0,Z80_BUS

.StartZ80:
		nop
		nop
		nop
		nop
		btst	#0,Z80_BUS
		beq.s	.StartZ80

.End:
		rts
; End of function UpdateSound

