	rts

; --------------------------------------------------------------
; Stop all sound
; --------------------------------------------------------------

StopSound:
	movem.l	d0,-(sp)

	move.b	#$6F,d0
	jsr	PlaySound
	move.b	#$FE,d0
	jsr	PlaySound

	movem.l	(sp)+,d0
	rts

; --------------------------------------------------------------
; Pause sound
; --------------------------------------------------------------

PauseSound:
	move.b	#$FF,sound_playing
	rts

; --------------------------------------------------------------
; Unpause sound
; --------------------------------------------------------------

UnpauseSound:
	move.b	#$FF,sound_playing
	rts

