	rts

; --------------------------------------------------------------
; Play a sound
; --------------------------------------------------------------
; PARAMETERS:
;	d0.b	- Sound ID
; --------------------------------------------------------------

PlaySound:
	movem.l	d0-d1/a0,-(sp)
	
	tst.b	sound_queue_open
	beq.s	.End

	moveq	#0,d1
	lea	sound_queue,a0
	move.b	sound_queue_tail,d1
	move.b	d0,(a0,d1.w)

	addq.b	#1,d1
	move.b	d1,sound_queue_tail
	cmp.b	sound_queue_current,d1
	bne.s	.NotFull
	move.b	#0,sound_queue_open

.NotFull:
	move.b	#-1,sounds_queued

.End:
	movem.l	(sp)+,d0-d1/a0
	rts

; --------------------------------------------------------------
; Process the sound queue
; --------------------------------------------------------------
; RETURNS:
;	d0.b	- Sound ID
; --------------------------------------------------------------

ProcessSoundQueue:
	movem.l	d1/a0,-(sp)
	
	tst.b	sounds_queued
	beq.s	.End

	moveq	#0,d1
	lea	sound_queue,a0
	move.b	sound_queue_current,d1
	move.b	(a0,d1.w),d0

	addq.b	#1,d1
	move.b	d1,sound_queue_current
	cmp.b	sound_queue_tail,d1
	bne.s	.NotEmpty
	move.b	#0,sounds_queued

.NotEmpty:
	move.b	#-1,sound_queue_open

.End:
	movem.l	(sp)+,d1/a0
	rts

; --------------------------------------------------------------
; Initialize the sound queue
; --------------------------------------------------------------

InitSoundQueue:
	moveq	#0,d0
	move.b	d0,sound_queue_tail
	move.b	d0,sound_queue_current
	move.b	#-1,sound_queue_open
	move.b	d0,sounds_queued

	lea	sound_queue,a0
	moveq	#$100/$10-1,d7

.Clear:
	move.l	d0,(a0)+
	move.l	d0,(a0)+
	move.l	d0,(a0)+
	move.l	d0,(a0)+
	dbf	d7,.Clear

	rts

