; --------------------------------------------------------------
; Initialize sprite drawing
; --------------------------------------------------------------

InitSpriteDraw:
	clr.w	draw_order
	clr.w	sprite_count
	rts

; --------------------------------------------------------------
; Draw actors
; --------------------------------------------------------------

DrawActors:
	tst.w	sprite_count
	beq.w	.DoDraw
	rts

.DoDraw:
	lea	actors,a0
	moveq	#aSize,d2
	tst.w	draw_order
	beq.w	.StartDraw
	lea	actors_end-aSize,a0
	moveq	#-aSize,d2

.StartDraw:
	lea	sprite_buffer+8,a1
	lea	SpriteMappings,a2
	lea	sprite_layers+1,a4

	move.w	#$3F,d0
	move.w	#1,d1
	move.b	player_1_flags,d4
	rol.b	#1,d4
	andi.b	#1,d4
	eori.b	#1,d4
	move.b	player_2_flags,d5
	rol.b	#2,d5
	andi.b	#2,d5
	eori.b	#2,d5
	or.b	d5,d4
	ori.b	#$C,d4

.DrawLoop:
	move.b	aField0(a0),d5
	and.b	d4,d5
	beq.w	.NextActor
	
	btst	#7,aDrawFlags(a0)
	beq.w	.NextActor

	movem.l	d2,-(sp)
	bsr.w	DrawActorSprite
	movem.l	(sp)+,d2

.NextActor:
	adda.l	d2,a0
	dbf	d0,.DrawLoop

	bsr.w	SetSpriteLinks
	lsl.w	#2,d1
	move.w	d1,sprite_count
	not.w	draw_order

	rts

; --------------------------------------------------------------
; Set sprite links
; --------------------------------------------------------------
; PARAMETERS:
;	d1.w	- Sprite count
; --------------------------------------------------------------

SetSpriteLinks:
	lea	sprite_layers,a0
	lea	sprite_links,a1
	
	move.w	#5-1,d0
	move.b	#0,d2

.LayerLoop:
	move.w	d1,d3
	subq.w	#1,d3

.CheckLayer:
	cmp.b	(a0,d3.w),d0
	bne.w	.NextLayer
	bsr.w	SetSpriteLink

.NextLayer:
	dbf	d3,.CheckLayer
	dbf	d0,.LayerLoop

	lea	sprite_buffer,a0
	move.w	d1,d0
	subq.w	#1,d0

.SetLinks:
	move.b	(a1)+,3(a0)
	adda.l	#8,a0
	dbf	d0,.SetLinks

	rts

; --------------------------------------------------------------
; Set a sprite link
; --------------------------------------------------------------
; PARAMETERS:
;	d2.b	- Sprite link value
;	d3.w	- Sprite link buffer index
;	a1.l	- Pointer to sprite link buffer
; --------------------------------------------------------------

SetSpriteLink:
	move.b	d2,(a1,d3.w)
	move.b	d3,d2
	rts

; --------------------------------------------------------------
; Draw an actor
; --------------------------------------------------------------
; PARAMETERS:
;	d1.w	- Current sprite count
;	a0.l	- Pointer to actor slot
;	a1.l	- Pointer to sprite buffer
;	a2.l	- Pointer to sprite mappings data table
;	a4.l	- Pointer to sprite layer buffer
; --------------------------------------------------------------

DrawActorSprite:
	clr.w	d2
	move.b	aMappings(a0),d2
	lsl.w	#2,d2
	movea.l	(a2,d2.w),a5
	
	clr.w	d2
	move.b	aFrame(a0),d2
	lsl.w	#2,d2
	movea.l	(a5,d2.w),a3
	move.w	(a3)+,d2
	subq.w	#1,d2

.DrawPieces:
	movem.l	a3,-(sp)
	bsr.w	DrawActorSpritePiece
	movem.l	(sp)+,a3

	adda.l	#8,a3
	dbf	d2,.DrawPieces

	rts

; --------------------------------------------------------------
; Draw a sprite piece for an actor
; --------------------------------------------------------------
; PARAMETERS:
;	d1.w	- Current sprite count
;	a0.l	- Pointer to actor slot
;	a1.l	- Pointer to sprite buffer
;	a3.l	- Pointer to sprite mappings data
;	a4.l	- Pointer to sprite layer buffer
; --------------------------------------------------------------

DrawActorSpritePiece:
	cmpi.w	#$50,d1
	bcs.w	.DoDraw
	rts

.DoDraw:
	addq.w	#1,d1

	move.w	(a3)+,d3
	add.w	aY(a0),d3
	sub.w	vscroll_buffer,d3
	move.w	d3,(a1)+

	move.b	(a3)+,(a1)+
	adda.l	#1,a1
	move.b	(a3)+,(a4)+
	move.w	(a3)+,(a1)+

	move.w	(a3)+,d3
	add.w	aX(a0),d3
	bne.w	.SetX
	addq.w	#1,d3

.SetX:
	move.w	d3,(a1)+

	rts


